import { useEffect, useState } from 'react';
import './App.css';
import axios from 'axios';

function App() {
  const [pokemon, setPokemon] = useState([]);
  const fetchPokemon =  async () => {
    try {
      let response = axios.get('http://localhost:5000/api/v1/pokemon/');
      console.log(response);
    }catch(err) {
      console.log(err);
    }
  };

  useEffect(() => {
    fetchPokemon();
  }, []);


  return (
    <div className="App">
      Hello World
    </div>
  );
}

export default App;
